import './App.css';
import AddFertilizer from './components/AddFertilizer';
import Header from './components/Header';
import {BrowserRouter as Router, Route} from "react-router-dom" 

function App() {
  return (

    <Router>
      <div>

        <Header/>

        <Route path= "/add" exact component= {AddFertilizer}/>


    </div>
    </Router>

  );
}
export default App;
